import maison1 from './images/maison1.jpg';
import maison2 from './images/maison2.jpeg';
import maison3 from './images/maison3.jpeg';


function Pictures() {
    return(
        <div>

            <div className="images" id="maison1">

               <img src={maison1} alt="Maison 1" />
                
            </div>

            <div className="images" id="maison2">

               <img src={maison2} alt="Maison 2" />

            </div>

            <div className="images" id="maison3">

               <img src={maison3} alt="Maison 3" />

            </div>

        </div>
    )
}

export default Pictures;
